// initial variables
let amount = 0.35;
let firstAmount = amount;
let martingle = 2.2;
let maximum_martingle = 5;
let martingleCount = 0;
let market = "R_25";
let settings = {
  OverBought: 70,
  OverSold: 30,
};
let activeTrade = false;
let spots = [];
let i = 0;
let Param = (contract, _amount) => {
  return { contract, amount: _amount, duration: 5 };
};

function main(data) {
  let d = data[data.msg_type];
  switch (data.msg_type) {
    case "login":
      // read 'id' for read 'limitAccounts'
      // d.id =  data.login.id
      console.log("client id : " + d.id);
      break;
    case "error":
      // if bot error 'more action'
      alert(d.message);
      Stop();
      break;
    case "portfolio":
      // portfolio onread
      if (activeTrade) {
        if (d.status == "won") {
          amount = firstAmount;
          martingleCount = 0;
          activeTrade = false;
        }
        if (d.status == "lost") {
          amount *= martingle;
          martingleCount++;
          activeTrade = false;
          if (martingleCount > maximum_martingle) {
            martingleCount = 0;
            amount = firstAmount;
          }
        }
      }
      break;
    case "price":
      // create triger logic
      // rsi({ values: <array>, period: <number>}) return <array>
      let rsi = indicator.rsi({ values: d.prices.slice(-100), period: 14 });
      rsi = parseInt(rsi[rsi.length - 1]);
      console.log(rsi)
      if (rsi <= settings.OverSold && !activeTrade) {
        activeTrade = true; // close queue trade
        Trade(Param("RISE", amount));
      }
      if (rsi >= settings.OverBought && !activeTrade) {
        activeTrade = true;
        Trade(Param("FALL", amount));
      }
      break;
  }
}
// Run(callback, market)
Run(main, "R_10");
